import { useQuery, gql } from '@apollo/client';
import client from "./apollo.client";

const FEED_QUERY = gql`
    {
        query {
            getCountries {
                name
                native
                languages
                capital
            }
        }
    }
`;

const CountryList = () => {
    let data = []
    client
        .query({
            query: FEED_QUERY
        })
        .then(result => data = result)
        .catch((error) => {
            console.log(error);
        });

    return (
        <div>
            {data && (
                <>
                    {data.map((item) => (
                        <p>{item.name}</p>
                    ))}
                </>
            )}
        </div>
    );
};

export default CountryList;
